  const [accessToken,setAccessToken] = useState("test");

  useEffect(() => {
    requestAccessToken().then(data => {
      setAccessToken(data.json());
    })
    setAccessToken(requestAccessToken());
  },[])

  console.log(accessToken)
  return (
    <div className="App">
      Hello World
      {accessToken.access_token}
    </div>
  );
}

export default App;
